import React, { Component } from "react";
class NotFound extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-4 col-md-offset-4">
            <h1>App HOME</h1>
          </div>
        </div>
      </div>
    );
  }
}

export default NotFound;
